import React, { useDeferredValue, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { useNavigate, useParams, useSearchParams } from 'react-router-dom';
import styled from 'styled-components';
import ResumeDetailBody from './ResumeDetailBody';
import ResumeDetailFooter from './ResumeDetailFooter';
import ResumeDetailToolbar from './ResumeDetailToolbar';

function CvMakePage() {
	const { isLogin } = useSelector((state) => state.UserDataReducer);
	const [introductionState, setIntroduction] = useState('');
	const introduction = useDeferredValue(introductionState);

	const [searchParams, setSearchParams] = useSearchParams();
	const modify = searchParams.get('modify');
	const { cvId } = useParams();

	const navigate = useNavigate();

	useEffect(() => {
		if (isLogin === false) {
			navigate('/cv/list');
		}
		if (modify === 'Y') {
		}
	}, []);

	return (
		<ComponentWrapper>
			<ResumeDetailToolbar />
			{modify === 'Y' ? (
				<ResumeDetailBody
					introduction={introduction}
					setIntroduction={setIntroduction}
				/>
			) : (
				<ResumeDetailBody
					introduction={introduction}
					setIntroduction={setIntroduction}
				/>
			)}

			<ResumeDetailFooter introduction={introduction} />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	width: 87.72%;
	padding: 0;
	max-width: 1060px;
	margin: 0 auto;
`;

export default CvMakePage;
